import React, { FC } from "react";
import { GetStaticProps } from "next";
import { initializeApollo } from "../lib/apollo";
import { searchQuery } from "../graphql/page/query/search";
import Layout from "../components/common/Layout";
// import SearchPost from "../components/search/SearchPostContainer";

const Search: FC = () => {
  return (
    <Layout>
      <h1>test</h1>
    </Layout>
  );
};

export async function getStaticPaths(test) {
  console.log(test);
  // return {
  //   //빌드 타임 때 아래 정의한  /dyna/1,  /dyna/2, ... /dyna/동적인값 경로만 pre렌더링.
  //   paths: [
  //     { params: { dynamic: 1 } },
  //     { params: { dynmic: 2 } }
  //     ......
  //     { params: { dynmic: 동적인값 } }
  //   ],
  //   // 만들어지지 않은 것도 추후 요청이 들어오면 만들어 줄 지 여부.
  //   fallback: true,
  // }
}

export const getStaticProps: GetStaticProps = async context => {
  console.log(context);
  const apolloClient = initializeApollo();
  await apolloClient.query({
    query: searchQuery,
    variables: {
      first: 10
    }
  });

  return {
    props: {
      initialApolloState: apolloClient.cache.extract()
    },
    revalidate: 1
  };
};

export default Search;
